package main

import (
	"strings"
	"fmt"
	"encoding/base64"
	"io/ioutil"
)

func isBase64Image(url string) bool {
	if strings.HasPrefix(url, "data:") {
		return true
	}
	return false
}

func convertBase64Image(url string) (imageData []byte, ext string, err error) {
	temp := strings.Split(url, ";base64,")
	if len(temp) < 2 {
		fmt.Println("len is must more than 2")
		return
	}
	ext = strings.Replace(temp[0], "data:image/", "", -1)
	base64data := strings.Replace(temp[1], "\n", "", -1)
	imageData, err = base64.StdEncoding.DecodeString(base64data)
	if err != nil {
		return nil, "", err
	}

	return
}

func main() {
	url := `data:image/jpeg;base64,`
	if isBase64Image(url) {
		imageData, ext, err := convertBase64Image(url)
		if err != nil {
			fmt.Println(err)
			return
		}
		filename := fmt.Sprintf("test2.%s", ext)
		ioutil.WriteFile(filename, imageData, 0660)
	}
}
